import React from 'react';
import './Gallery.css';

const Gallery = () => {
  const galleryImages = [
    {
      id: 1,
      src: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=800',
      title: 'Desert Adventure',
      category: 'Buggies'
    },
    {
      id: 2,
      src: 'https://images.unsplash.com/photo-1519682337058-a94d519337bc?w=800',
      title: 'ATV Riding',
      category: 'ATVs'
    },
    {
      id: 3,
      src: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=800',
      title: 'Dune Bashing',
      category: 'Adventure'
    },
    {
      id: 4,
      src: 'https://images.unsplash.com/photo-1519682337058-a94d519337bc?w=800',
      title: 'Group Tour',
      category: 'Tours'
    },
    {
      id: 5,
      src: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=800',
      title: 'Sunset Ride',
      category: 'Buggies'
    },
    {
      id: 6,
      src: 'https://images.unsplash.com/photo-1519682337058-a94d519337bc?w=800',
      title: 'Desert Safari',
      category: 'Adventure'
    },
    {
      id: 7,
      src: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=800',
      title: 'Off-Road Experience',
      category: 'Buggies'
    },
    {
      id: 8,
      src: 'https://images.unsplash.com/photo-1519682337058-a94d519337bc?w=800',
      title: 'Family Adventure',
      category: 'Tours'
    }
  ];

  return (
    <div className="gallery-page">
      <div className="hero-section">
        <div className="hero-overlay">
          <div className="container">
            <div className="hero-content">
              <h1>Gallery</h1>
              <p>Home â†’ Gallery</p>
            </div>
          </div>
        </div>
      </div>

      <div className="gallery-content">
        <div className="container">
          <div className="gallery-intro">
            <span className="section-label">From our gallery</span>
            <h2>Adventure Moments</h2>
            <p>Experience the thrill through our customers' adventures</p>
          </div>

          <div className="gallery-grid">
            {galleryImages.map((image) => (
              <div key={image.id} className="gallery-item">
                <img src={image.src} alt={image.title} />
                <div className="gallery-overlay">
                  <h3>{image.title}</h3>
                  <span className="gallery-category">{image.category}</span>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Gallery;
